VALUES('PRA1', 'ADJST_TMS', '00000290', NULL, NULL, 'N', 'TIMESTAMP(0)', 42, '2022-08-12 00:00:00.000', 'AUTO', NULL, 'Adjusted Through Date/Time', 'This is one of two important date fields (the other being the As-Of Date/Time field) in each History table.  The Adjusted-Through Date/Time field indicates the most recent date and time that an accounting transaction that affected the balance in the History table occurrence was posted. For example, when a current balance is first copied into a History table occurrence, the values in the As-Of Date/Time field and the Adjusted-Through Date/Time field are the same (for example, 12/31/2005 16:30).  At any time subsequent to the capture of that balance on a History table occurrence, a "late transaction" can occur whose effective date is on or prior to the value recorded in the As-Of Date/Time field (for example, a transaction is posted on 01/06/2006 with an effective date of 12/31/2005).  In order to properly reflect the "late transaction" in the History table occurrence, a second "adjusted" History table occurrence is created, indicating both the effective ("as-of") date/time and the actual posting date. For example, the dates on the new History table occurrence would be As-Of Date/Time = 12/31/2005 16:30, Adjusted-Through Date/Time = 01/06/2006 18:20.  Note that the use of the Adjusted-Through Date/Time field in conjunction with the As-Of Date/Time field allows you to record the original unadjusted historical balance on one occurrence of the History table, and the corrected balance on another occurrence of the History table.', 'DATE', 0, 0, 0, NULL, 'Adjusted_Through_Date/Time', NULL, NULL, 'DATE/TIME', NULL, NULL, NULL, NULL, NULL, NULL);
